import React, { useRef, useEffect, useState } from 'react';
import axios from 'axios';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';


import CardItem from './CardItem';

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const App = () => {
    const [recommendationData, setRecommendationData] = useState();
    useEffect(() => {
    axios.get('http://localhost:8080/recommend')
            .then((response) => {
                console.log(response);
                setRecommendationData(response.data);
            }).catch((error) => {
                console.log(error);
            }).then(()=>{
                console.log("Finally")
            });  
    },[]);

    useEffect(()=> {

    },[recommendationData]);

    return (

    <Grid container spacing={2} >
        <Grid item xs={12}>
          <Item>xs=16</Item>
        </Grid>

            <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, paddingLeft: 30}} variant="h6" component="div">
            BTC
          </Typography>
                </Grid>
                <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, paddingLeft: 30}} variant="h6" component="div">
            ETH
          </Typography>
                </Grid>

            <Grid item xs={5} md ={6} container justifyContent="center"  >

                <Item>
                <CardItem />
                </Item>
                <Item>
                <CardItem />
                </Item>
                <Item>
                <CardItem />
                </Item>
                <Item>
                <CardItem />
                </Item>
            </Grid>

            <Grid item xs={5} md ={6} container justifyContent="center"  >

                <Item><CardItem /></Item>
            </Grid> 

            <Grid item xs={12} >
            <Typography sx={{ mt: 4, mb: 2, content: "center"}} variant="h6" component="div">
            Recommendation
          </Typography>
                <Item> </Item>
            </Grid>

      </Grid>
      );
}

export default App;
